import React from 'react';
import {
  Container,
  Typography,
  Paper,
  Box,
  Button,
} from '@mui/material';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import { useNavigate } from 'react-router-dom';

const Results = () => {
  const navigate = useNavigate();

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      {/* Back Button */}
      <Button
        startIcon={<ArrowBackIcon />}
        onClick={() => navigate('/')}
        sx={{ mb: 3 }}
      >
        Back to Video
      </Button>

      {/* Page Title */}
      <Typography variant="h3" component="h1" gutterBottom textAlign="center">
        Analysis Results
      </Typography>

      {/* Video Display */}
      <Paper elevation={3} sx={{ p: 4, mt: 4 }}>
        <Box sx={{ 
          width: '100%',
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          gap: 2,
        }}>
          <video
            controls
            autoPlay
            src="C:\code\abdullah\processed\result_out.mp4"
            style={{
              width: '100%',
              maxHeight: '70vh',
              objectFit: 'contain',
              backgroundColor: '#000',
              borderRadius: '8px',
            }}
          >
            Your browser does not support the video tag.
          </video>
        </Box>
      </Paper>
    </Container>
  );
};

export default Results;
